import React from 'react'

function Navbar() {
    return (
        <nav className="bg-gray-100">
            <div className="max-w-5xl border  border-yellow-400">
                    <div>home</div>
                    <div>about us</div>
            </div>
        </nav>
    )
}

export default Navbar
